import React from 'react'

import AvailableMeals from './AvailableMeals'
import Cart from '../Cart/Cart'

const Meals = (props) => {
  return (
    <React.Fragment>
      <AvailableMeals />
      {props.cartIsShown && <Cart onClose={props.cartOnClose} />}
    </React.Fragment>
  )
}

export default Meals
